import React, { useState } from 'react';
import './App.css';

const initialItems = [
  { id: 1, name: 'Apple', description: 'Fresh and juicy apples.', price: 30, image: 'data:image/jpeg;base64,' },
  { id: 2, name: 'Banana', description: 'Sweet yellow bananas.', price: 20, image: 'data:image/jpeg;base64,' },
  { id: 3, name: 'Cherry', description: 'Red, ripe cherries.', price: 10, image: 'data:image/jpeg;base64,' },
  { id: 4, name: 'orange', description: 'orange is a energy drink',price:40,image:'data:image/jpeg;base64,'},
  { id: 5, name: 'watermeloan',description: 'it a low calary fruit', price:60, image:'data:image/jpeg;base64,'},
  { id :6 , name: 'egg', description:'its high vetamin ',price:5, image:'data:image/jpeg;base64,'},
  {id:7,name:'cow milk',description:'its good for helth', price:20,image:'data:image/jpeg;base64,'},
];

function App() {
  const [items] = useState(initialItems);
  const [cart, setCart] = useState([]);

  const addToCart = (item) => {
    setCart([...cart, item]);
  };

  const removeFromCart = (itemId) => {
    setCart(cart.filter(item => item.id !== itemId));
  };

  const isInCart = (itemId) => {
    return cart.some(item => item.id === itemId);
  };

  const getCartTotal = () => {
    return cart.reduce((total, item) => total + item.price, 0).toFixed(2);
  };

  return (
    <div className="App">
      <h1>Shopping Cart</h1>
      <div className="items">
        <h2>Available Products</h2>
        <ul>
          {items.map(item => (
            <li key={item.id} className="product-item">
              <img src={item.image} alt={item.name} className="product-image" />
              <div className="product-details">
                <strong>{item.name}</strong> - ${item.price}
                <p>{item.description}</p>
                <button
                  onClick={() => isInCart(item.id) ? removeFromCart(item.id) : addToCart(item)}
                >
                  {isInCart(item.id) ? 'Remove from Cart' : 'Add to Cart'}
                </button>
              </div>
            </li>
          ))}
        </ul>
      </div>
      <div className="cart">
        <h2>Cart</h2>
        <ul>
          {cart.map(item => (
            <li key={item.id}>
              {item.name} - ${item.price}
              <button onClick={() => removeFromCart(item.id)}>Remove from Cart</button>
            </li>
          ))}
        </ul>
        <h3>Total: ${getCartTotal()}</h3>
        <h3>Quantity: {cart.length}</h3>
      </div>
    </div>
  );
}

export default App;
